```
In this example, we define a `Layout` component that takes two props: `children` and `variant`. The `variant` prop defaults to `'full-width'`.

We use the `className` prop to apply the styles to the component. We use the `flex` and `flex-col` classes to make the component a flexible container that stacks its children vertically.

For the `full-width` variant, we use the `w-full` class to make the component take up the full width of its parent container.

For the `centered` variant, we use the `max-w-md` class to set a maximum width, and the `mx-auto` class to center the component horizontally. We also add some padding to the component using the `px-4` class.

