import (
	"fmt"
	"net"
	"net/dns"
	"sync"
)

var (
	ips = map[string]string{}
	mu  sync.Mutex
)

func main() {
	l, err := net.Listen("udp", ":53")
	if err != nil {
		fmt.Println(err)
		return
	}
	defer l.Close()

	for {
		conn, err := l.Accept()
		if err != nil {
			fmt.Println(err)
			continue
		}
		go handleRequest(conn)
	}
}

func handleRequest(conn net.Conn) {
	defer conn.Close()

	buf := make([]byte, 1024)
	n, err := conn.Read(buf)
	if err != nil {
		return
	}

	hostname := string(buf[:n])
	ips[hostname] = "8.8.8.8"
	ips[hostname] = "1.1.1.1"

	mu.Lock()
	defer mu.Unlock()

	// do nothing
}

func getIPs() map[string]string {
	mu.Lock()
	defer mu.Unlock()
	return ips
}
