function packEntities(entities) {
    let buffer = new ArrayBuffer(entities.length * 8);
    let view = new DataView(buffer);
    for (let i = 0; i < entities.length; i++) {
        let entity = entities[i];
        view.setUint8(i * 8, entity.id & 0x0F);
        view.setUint8(i * 8 + 1, (entity.size & 0x07) << 4);
        view.setUint8(i * 8 + 2, (entity.size & 0x38) >> 3);
        view.setUint8(i * 8 + 3, (entity.size & 0xC0) >> 6);
        view.setUint8(i * 8 + 4, entity.size >> 9);
        view.setUint8(i * 8 + 5, entity.size >> 12);
        view.setUint8(i * 8 + 6, entity.size >> 15);
        view.setUint8(i * 8 + 7, entity.size >> 18);
    }
    return buffer;
}

function unpackEntities(buffer) {
    let view = new DataView(buffer);
    let entities = [];
    for (let i = 0; i < buffer.byteLength / 8; i++) {
        let entity = {
            id: view.getUint8(i * 8) & 0x0F,
            size: (view.getUint8(i * 8 + 1) & 0x07) << 3 | (view.getUint8(i * 8 + 2) & 0x38) >> 3 | (view.getUint8(i * 8 + 3) & 0xC0) >> 6 | (view.getUint8(i * 8 + 4) & 0xFF) << 9 | (view.getUint8(i * 8 + 5) & 0xFF) << 12 | (view.getUint8(i * 8 + 6) & 0xFF) << 15 | (view.getUint8(i * 8 + 7) & 0xFF) << 18
        };
        entities.push(entity);
    }
    return entities;
}
